DROP TABLE IF EXISTS `j_address`;
CREATE TABLE `j_address` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `userid` int(10) DEFAULT NULL COMMENT '用户ID',
  `truename` varchar(100) DEFAULT NULL COMMENT '收货人姓名',
  `mobile` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `prov` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(255) DEFAULT NULL COMMENT '城市',
  `address` varchar(255) DEFAULT NULL COMMENT '具体地址',
  `is_use` tinyint(2) DEFAULT '0' COMMENT '是否设置为默认',
  `ctime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_admin`;
CREATE TABLE `j_admin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `roleid` smallint(5) DEFAULT '4',
  `name` varchar(20) NOT NULL DEFAULT '',
  `mobile` varchar(20) DEFAULT '',
  `email` varchar(50) NOT NULL DEFAULT '',
  `password` varchar(32) NOT NULL DEFAULT '',
  `truename` varchar(50) DEFAULT '',
  `ctime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `etime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `login_ip` varchar(20) DEFAULT '',
  `remark` varchar(255) DEFAULT '',
  `login_times` smallint(8) DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '0:禁止登陆 1:正常',
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`name`),
  KEY `password` (`password`) USING BTREE
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_advertise`;
CREATE TABLE `j_advertise` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(10) DEFAULT '' COMMENT '标题',
  `description` text COMMENT '描述',
  `picurl` varchar(150) DEFAULT '' COMMENT '图片',
  `connector` varchar(150) DEFAULT '' COMMENT 'H5接口',
  `etime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '编辑时间',
  `type` smallint(2) unsigned DEFAULT '0' COMMENT '类型',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态',
  `sort` smallint(4) DEFAULT '5' COMMENT '排序',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_agent`;
