DROP TABLE IF EXISTS `j_girdle_time`;
CREATE TABLE `j_girdle_time` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `userid` int(10) NOT NULL DEFAULT '0',
  `times` smallint(6) DEFAULT '1',
  `ctime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `etime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_hospital`;
CREATE TABLE `j_hospital` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) DEFAULT '' COMMENT '医院名称',
  `address` varchar(255) DEFAULT '' COMMENT '地址',
  `tel` varchar(50) DEFAULT '' COMMENT '医院电话',
  `provid` int(10) DEFAULT '0' COMMENT '省ID',
  `cityid` int(10) DEFAULT '0' COMMENT '市ID',
