) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_manager`;
CREATE TABLE `j_manager` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `roleid` tinyint(1) DEFAULT '1' COMMENT '角色ID（区域经理默认1）',
  `name` varchar(50) DEFAULT '' COMMENT '账号',
