DROP TABLE IF EXISTS `j_order`;
CREATE TABLE `j_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `userid` mediumint(8) NOT NULL COMMENT '用户id',
