  `etime` int(10) DEFAULT NULL COMMENT '订单修改时间',
  `remark` text COMMENT '备注',
  `ip` char(15) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT 'ip地址',
  `isdel` tinyint(1) DEFAULT '1' COMMENT '是否删除(1否，0是，仅适用付款订单)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `trade_sn` (`trade_sn`),
  KEY `userid` (`userid`),
  KEY `s_i_t_i` (`status`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
