DROP TABLE IF EXISTS `j_product`;
CREATE TABLE `j_product` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '商品名称',
  `intro` varchar(255) DEFAULT '' COMMENT '商品简介',
  `content` text NOT NULL COMMENT '商品详情',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '单价',
  `img` varchar(255) NOT NULL DEFAULT '' COMMENT '商品图片',
  `thumb_img` varchar(255) DEFAULT '' COMMENT '缩略图',
  `inventory` int(10) DEFAULT '0' COMMENT '库存数量',
  `sale_count` int(10) DEFAULT '0' COMMENT '销售量',
  `is_recommend` tinyint(2) DEFAULT '0' COMMENT '是否推荐',
  `show_time` int(10) DEFAULT '0' COMMENT '上架时间',
  `type` tinyint(2) DEFAULT '0' COMMENT '商品类型',
  `cate_id` char(50) DEFAULT NULL COMMENT '商品分类',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态，1上架，0下架',
  `ctime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `etime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `isdel` tinyint(1) DEFAULT '1' COMMENT '是否删除，1正常，0删除',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_region`;
CREATE TABLE `j_region` (
  `region_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(10) NOT NULL DEFAULT '0',
  `region_name` varchar(30) NOT NULL DEFAULT '',
  `spellname` varchar(30) NOT NULL DEFAULT '',
  `cityno` int(10) NOT NULL,
  `provid` int(10) NOT NULL,
  `layer` tinyint(1) DEFAULT NULL,
  `sort_order` smallint(6) NOT NULL DEFAULT '255',
  `dateline` int(10) NOT NULL DEFAULT '0',
  PRIMARY KEY (`region_id`),
  KEY `parent_id` (`parent_id`) USING BTREE
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_role`;
CREATE TABLE `j_role` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(20) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `pid` smallint(6) DEFAULT '0',
  `status` tinyint(1) unsigned DEFAULT '1',
  `remark` varchar(255) CHARACTER SET utf8 DEFAULT '',
  `ename` varchar(5) CHARACTER SET utf8 DEFAULT '',
  `listorder` smallint(6) DEFAULT '0',
  `create_time` int(11) unsigned NOT NULL DEFAULT '0',
  `update_time` int(11) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `parentId` (`pid`) USING BTREE,
  KEY `ename` (`ename`) USING BTREE,
  KEY `status` (`status`) USING BTREE,
  KEY `order` (`listorder`,`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_setting`;
CREATE TABLE `j_setting` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uversion` decimal(9,1) DEFAULT NULL COMMENT '版本号',
  `ufilemd5` char(32) DEFAULT '' COMMENT '版本签名',
  `ufileurl` varchar(150) DEFAULT '' COMMENT '版本下载',
  `etime` int(10) DEFAULT '0' COMMENT '编辑时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_sn`;
CREATE TABLE `j_sn` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `number` varchar(150) DEFAULT '' COMMENT 'SN号',
  `status` tinyint(1) DEFAULT '0' COMMENT '0未售出，1已售出，2，已作废',
  `ctime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `etime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `number` (`number`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_user`;
CREATE TABLE `j_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `sn` varchar(50) NOT NULL DEFAULT '' COMMENT '呼吸机SN号',
  `mobile` varchar(50) NOT NULL DEFAULT '' COMMENT '手机号',
  `password` varchar(255) NOT NULL DEFAULT '' COMMENT '密码',
  `username` varchar(50) DEFAULT '' COMMENT '用户名',
  `age` tinyint(2) DEFAULT '0' COMMENT '年龄',
  `gender` enum('男','女','未知') DEFAULT '未知' COMMENT '性别',
  `provid` int(10) DEFAULT '0' COMMENT '省ID',
  `cityid` int(10) DEFAULT '0' COMMENT '市ID',
  `address` varchar(255) DEFAULT '' COMMENT '住址',
  `email` varchar(255) DEFAULT '' COMMENT '邮箱',
  `doctorid` int(10) DEFAULT '0' COMMENT '医生ID',
  `openid` varchar(255) DEFAULT '' COMMENT '微信唯一ID',
  `ticket` varchar(50) DEFAULT '' COMMENT '验证登录票据',
  `status` tinyint(1) DEFAULT '1' COMMENT '1,正常，0冻结',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  `ctime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `etime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  UNIQUE KEY `mobile` (`mobile`),
  UNIQUE KEY `sn` (`sn`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
DROP TABLE IF EXISTS `j_userlogin`;
