  `id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `ticket` varchar(50) DEFAULT '' COMMENT '用户令牌',
  `userid` mediumint(8) DEFAULT '0' COMMENT '用户id',
  `device_type` tinyint(1) DEFAULT '2' COMMENT '设备类型（1.安卓，2.ios）',
  `device` varchar(50) DEFAULT '' COMMENT '设备名称2',
  `updatetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后登录时间',
  PRIMARY KEY (`id`)
) COLLATE='utf8_general_ci' ENGINE=MyISAM;
